import React from "react";

const ContactSection = styled.div`
width:100vw;
`
const Contact = () => {
  return <ContactSection>
    <Title>Request Service</Title>
    <Icons>
      <a href="https://www.yelp.com/biz/major-appliance-repair-everett-2">
        <img src="Agency-website/src/MySite/yelp.png" alt="Yelp" />
      </a>
      <a href="https://goo.gl/maps/ZLRVKagXNCkL9GPL9">
        <img src="Agency-website/src/MySite/googlemaps.png" alt="Google" />
      </a>

    </Icons>
  </ContactSection>;
};

export default Contact;
